/* 设备状态 */
export const deviceStatus = {
	0:'禁用',
	1:'启用'
}

/* 工单状态 */
export const workStatus = {
	0:"未派单",
	1:"已派单",
	2:"已响应",
	3:"已拒绝",
	4:"进行中",
	5:"已完成",
	6:"未完成",
	7:'已重派',
	8:'已完结',
	9:'待件中',
	10:'待件结束'
}

/* 生产计划单状态 */
export const planStatus = {
	1:'未处理',
	2:'已排程'
}

export const workLevel = {
	1:'紧急',
	2:'高级',
	3:'一般'
}
